import React from "react";
import Home from "./components/home";
import { Route, Switch } from "react-router-dom";

import "./App.css";

function App() {
  return (
    <main className="container">
      <Switch>
        <Route path="/hi" component={Home} />
        <Route path="/" component={Home} />
      </Switch>
    </main>
  );
}

export default App;
